import React from 'react';
import { useEffect } from 'react';
import { useState } from 'react';

function App(){
  const [backendData , setBackendData] = useState([{}])
  useEffect(()=>{
    fetch("/admin").then(
      response => response.json()
    ).then(
      data=>{
        setBackendData(data)
      }
    )
  },[])
  return (
    <div>
    </div>
  )
}

export default App
